import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import styles from './index.css';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


function createData(
    // name: string,
    // calories: number,
    // fat: number,
    // carbs: number,
    // protein: number,
    motorNumber , partNumber

  ) {
    return { motorNumber , partNumber };
  }



  const rows = [
    createData('Motor one', 'Part one'),
    createData('Motor two', 'Part Two'),
  ]


const Home = () => {
  return (
    <div class="grid-container" style={{display:'flex',alignItems:'center',height:'50vh'}}> 
        <div class="grid-item">
            <div style={{border:'1px solid red'}}>
                <h2>Motor Form</h2>
                <TextField id="outlined-basic" label="Motor Number" variant="outlined"/>
                <TextField id="outlined-basic" label="Part Number" variant="outlined"/>
                <Button variant="contained">ADD MOTOR</Button>
            </div>

            <div>
                <TableContainer component={Paper}>
                    <Table sx={{ minWidth: 250 }} aria-label="simple table">
                        <TableHead>
                        <TableRow>
                            <TableCell>Motor motorNumber</TableCell>
                            <TableCell align="left">Part Number</TableCell>
                        </TableRow>
                        </TableHead>
                        <TableBody>
                        {rows.map((row) => (
                            <TableRow
                            key={row.motorNumber}
                            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                            >
                            <TableCell component="th" scope="row">
                                {row.motorNumber}
                            </TableCell>
                            <TableCell align="left">{row.partNumber}</TableCell>
                            </TableRow>
                        ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            </div>
            <Button variant="contained">GET LATEST DATA TO TABLE</Button>
        </div>
        <div class="grid-item">
            <div style={{border:'1px solid red'}}>
                <h2>Battery Form</h2>
                <TextField id="outlined-basic" label="Motor Number" variant="outlined"/>
                <TextField id="outlined-basic" label="Part Number" variant="outlined"/>
                <Button variant="contained">ADD BATTERY</Button>
            </div>
            <div>
                Battery data table
            </div>
        </div>

    </div>
  )
}

export default Home;
